import React, { useState } from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './index.css';
import ProductList from './ProductList';
import Cart from './Cart';
import heroImg from './assets/hero.png';
import RotasPage from './RotasPage';
import ProductDetails from './ProductDetails';


const DummyPage = ({ title }) => (
  <div className="min-h-screen flex items-center justify-center">
    <h1 className="text-3xl font-bold text-gray-700">{title}</h1>
  </div>
);

const App = () => {
  const [cartItems, setCartItems] = useState([]);
  const [showDropdown, setShowDropdown] = useState(false);

  const addToCart = (product) => {
    setCartItems((prev) => [...prev, product]);
  };

  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <header className="bg-white shadow-md sticky top-0 z-50">
          <div className="max-w-6xl mx-auto flex justify-between items-center p-4 relative">
            <div className="flex items-center gap-2">
              <img src="https://balturotas.lv/logo.svg" alt="Baltu Rotas" className="h-10" />
              <span className="text-xl font-bold tracking-wide">Baltu Rotas</span>
            </div>
            <nav className="hidden sm:flex gap-6 text-sm font-medium relative">
              <div
                onMouseEnter={() => setShowDropdown(true)}
                onMouseLeave={() => setShowDropdown(false)}
                className="relative"
              >
                <button className="hover:text-blue-600">Rotas</button>
                {showDropdown && (
                  <div className="absolute top-full left-0 mt-2 bg-white shadow-lg rounded p-6 grid grid-cols-2 gap-10 w-[600px] text-black z-50">
                    <div>
                      <h3 className="font-semibold mb-2">Rotas</h3>
                      <ul className="space-y-1">
                        <li><Link to="/visas-rotas" className="hover:underline">Visas rotas</Link></li>
                        <li><Link to="/gredzeni" className="hover:underline">Gredzeni</Link></li>
                        <li><Link to="/aproces" className="hover:underline">Aproces</Link></li>
                        <li><Link to="/auskari" className="hover:underline">Auskari</Link></li>
                        <li><Link to="/piespraudes-saktas" className="hover:underline">Piespraudes, Saktas</Link></li>
                        <li><Link to="/kuloni-kaklarotas" className="hover:underline">Kuloni, Kaklarotas</Link></li>
                        <li><Link to="/aprocpogas" className="hover:underline">Aro캜pogas</Link></li>
                      </ul>
                    </div>
                    <div>
                      <h3 className="font-semibold mb-2">Kolekcijas</h3>
                      <ul className="space-y-1">
                        <li><Link to="/laulibu-gredzeni" className="hover:underline">Laul캶bu gredzeni</Link></li>
                        <li><Link to="/saulespukes" className="hover:underline">Saulespu컁es</Link></li>
                        <li><Link to="/kafija-krustnaglinas" className="hover:underline">Kafija un krustnagli켽as</Link></li>
                        <li><Link to="/namejs" className="hover:underline">Namejs</Link></li>
                        <li><Link to="/rozes" className="hover:underline">Rozes</Link></li>
                        <li><Link to="/senas-zimes" className="hover:underline">Sen캐s z캶mes</Link></li>
                      </ul>
                    </div>
                  </div>
                )}
              </div>
              <a href="#sakums" className="hover:text-blue-600">S캐kums</a>
              <a href="#veikals" className="hover:text-blue-600">Veikals</a>
              <a href="#kontakti" className="hover:text-blue-600">Kontakti</a>
            </nav>
            <div className="text-sm text-gray-600">游 {cartItems.length} prece(s)</div>
          </div>
        </header>

        <Routes>
        <Route path="/visas-rotas" element={<RotasPage />} />
          <Route
            path="/"
            element={
              <>
                <section
                  id="sakums"
                  className="h-screen bg-cover bg-center flex items-center justify-center text-center text-white px-4"
                  style={{ backgroundImage: `url(${heroImg})` }}
                >
                  <h1 className="text-base sm:text-lg md:text-xl max-w-2xl leading-relaxed font-normal">
                    Nest savas saknes k캐 rotu. Katr캐 rot캐 dz캶vo k캐ds st캐sts. Par zem캡 un taut캐 sak켽otu dz캶ves gudr캶bu.
                    Par dabas nepieradin캐t캶bu. Par stipr캐s dzimt캐s kaltin캐tu briedumu un drosmi.
                  </h1>
                </section>

                <section id="veikals" className="bg-gray-50 py-10">
                  <ProductList onAddToCart={addToCart} />
                </section>

                <section id="kontakti" className="bg-white py-10">
                  <div className="max-w-3xl mx-auto px-4">
                    <h2 className="text-2xl font-bold mb-4">Kontakti</h2>
                    <p className="text-gray-700 mb-2">E-pasts: info@balturotas.lv</p>
                    <p className="text-gray-700">T캐lrunis: +371 12345678</p>
                  </div>
                </section>
              </>
            }
          />

          {[
            'visas-rotas',
            'gredzeni',
            'aproces',
            'auskari',
            'piespraudes-saktas',
            'kuloni-kaklarotas',
            'aprocpogas',
            'laulibu-gredzeni',
            'saulespukes',
            'kafija-krustnaglinas',
            'namejs',
            'rozes',
            'senas-zimes',
          ].map((slug) => (
            <Route
              key={slug}
              path={`/${slug}`}
              element={<DummyPage title={slug.replace(/-/g, ' ').toUpperCase()} />}
            />
          ))}
        </Routes>

        <Cart items={cartItems} />
      </div>
    </Router>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
